import styled from "styled-components";

const Container = styled.div`
display: flex;
flex-direction: column;
margin: auto;
align-items: center;
box-shadow: 0 3px 6px 0 #555;
padding: 20px 10px;
border-radius: 4px;
width: 380px;
background: yellow;
`;


const AppLabel = styled.span`
color: black
flex-direction: column;
`;

const CityComponent = styled.span`
color: black;
margin: 20px auto;
font-size: 18px;
font-weight: bold;
`;

const WeatherComponent = styled.span`
padding: 2px 3px;
background-color: black;
border-radius: 50%;
color: white;
position: absolute;
`;
function App() {
  return (
    <Container>
      <AppLabel>The Weather </AppLabel>
      <CityComponent>CityComponent</CityComponent>
      <WeatherComponent>WeatherComponent</WeatherComponent>
    </Container>
  );
}

export default App;
